import React, { useState } from 'react';
import './App.css';
import { Button } from 'antd';
import TimeProgress from './TimeProgress';

const App: React.FC = () => {
  const [sessions, setSessions] = useState([
    { title: 'Warm-UP', time: 15, color: '#264653cc' },
    { title: 'Common Sentences', time: 20, color: '#2a9d8fcc' },
    { title: 'Listening', time: 30, color: '#e9c46acc' },
    { title: 'Speaking', time: 20, color: '#f4a261cc' },
    { title: 'Discussion', time: 20, color: '#e76f51cc' },
    { title: 'Fixing Issues', time: 15, color: '#fcbf49cc' },
  ]);

  const sessionsList = (
    <div className="sessions-container">
      {sessions.map((s) => (
        <div>
          {s.title}: {s.time}mins
        </div>
      ))}
    </div>
  );

  return (
    <div className="app">
      <h1>Class Timer</h1>
      <hr />
      {sessionsList}
      <hr />
      <TimeProgress sessions={sessions} />
      {/* <Button type="primary">Button</Button> */}
    </div>
  );
};

export default App;
